import {
    makeStyles
} from "@material-ui/core/styles";

import WebFont from "webfontloader";

WebFont.load({
    google: {
        families: ["Dancing Script:300,400,700", "cursive"],
    },
});

const useStyles = makeStyles((theme) => ({
    root: {
        position: "fixed",
    },
    container: {
        minHeight: "350px",
        width: "100%"
    },
    welcome: {
        textAlign: "center",
        color: "red",
        lineHeight: "350px",
    }
}));

export default useStyles;
